import { Route, Switch } from 'react-router-dom';

// Pages
import MainPage from './pages/MainPage';

import { useState, createContext, useContext } from "react";


function App() {


  return(
    <div>


      <Switch>
        <Route path='/' exact>
          <MainPage />
        </Route>

      </Switch>

    </div>
  );

}

export default App;
